  `biaoji` varchar(255) DEFAULT '0' COMMENT '标记',
  `sign_message` varchar(255) DEFAULT NULL,
  `sex` varchar(255) DEFAULT NULL COMMENT '字符串性别',
  PRIMARY KEY (`id`)
